	private static void doIt(String arg) throws InterruptedException, IOException {
		Thread.sleep(200);

		WebURL urlToFetch = new WebURL();
		urlToFetch.setURL(arg);
		Page page = new Page(urlToFetch);
		
		if (PageFetcher.fetch(page, true) != PageFetchStatus.OK) {
			System.err.println("auction list fetch failed :(");
			return;
		}

		Document doc = Jsoup.parse(page.getHTML());
		Element span = doc.getElementsByClass("countClass").first();
		String count = span.text();
		
		String title = doc.getElementsByTag("title").first().text();
		String seller = title.substring(0, title.indexOf(" "));
		
		System.out.println(seller + "\t" + count);
		
	}
